import React, { useEffect } from "react";
import { Link, useHistory } from "react-router-dom";
import { useSelector } from "react-redux";
import TextareaAutosize from "react-textarea-autosize";

const Landing = () => {
  const isAuth = useSelector((state) => state.auth.isAuthenticated);
  const history = useHistory();

  // If logged in redirect to dashboard
  useEffect(() => {
    if (isAuth) history.push("/dashboard");
  }, [isAuth]);
  return (
    <div className="container">
      <div class="row justify-content-center align-items-center m-l70">
        <div class="col-8 p-0">
          <div class="inner__section mt-4">
            <div class="input-group main__input mb-3">
              <TextareaAutosize
                type="text"
                class="form-control input__type__inner"
                placeholder="HOW DO YOU FEEL?"
                aria-label="Username"
                aria-describedby="basic-addon1"
                minRows={1}
                maxRows={6}
              />
            </div>
          </div>
        </div>
        <div class="col-1">
          <button class="btn btn-secondary btn__main text-uppercase">Predict</button>
        </div>
      </div>
    </div>
  );
};

export default Landing;
